			let flag = false;

			function audioVolumeChangeCallback(volume){

			}

			//调整声音
			function audioChange(){
				if(typeof(SoundManager)=='underfined')return;
				let volume = dapi.getAudioVolume()/100;
				egret.log("当前音量",volume);
				if(volume == 0 || dapi.isViewable() == false){ 
					SoundManager.Instance.isMusic = false;
					SoundManager.Instance.isEffect = false;
					SoundManager.Instance.volume = 0;
				}else{
					//打开声音
					egret.log("打开声音");
					SoundManager.Instance.isMusic = true;
					SoundManager.Instance.isEffect = true;
					SoundManager.Instance.volume = volume;
				}
			}

			function onReadyCallBack(){
				//无需再监听此事件
				dapi.removeEventListener("ready", onReadyCallBack);
				let isAudioEnabled = !!dapi.getAudioVolume();
				let screenSize = dapi.getScreenSize();
					
				dapi.addEventListener("viewableChange", adVisibleCallback);
				dapi.addEventListener("adResized", adResizeCallback);
				dapi.addEventListener("audioVolumeChange", audioVolumeChangeCallback);

				adVisibleCallback({isViewable:dapi.isViewable()});
			}

			function adVisibleCallback(event){
				egret.log("isViewAble " + event.isViewable);
				if (event.isViewable) {
					egret.log("广告展示");
					if(!flag)engineRun();
					audioChange();
				} else {
					egret.log('广告隐藏');
					audioChange();
				}
			}

			function engineRun(){
				flag = true;
				//引擎执行
				egret.runEgret({renderMode: "webgl",audioType: 3,
					calculateCanvasScaleFactor: function(context) {
						var backingStore = context.backingStorePixelRatio ||
							context.webkitBackingStorePixelRatio ||
							context.mozBackingStorePixelRatio ||
							context.msBackingStorePixelRatio ||
							context.oBackingStorePixelRatio ||
							context.backingStorePixelRatio || 1;
							return (window.devicePixelRatio || 1) / backingStore;
						}
					});
			}

			function adResizeCallback(event){
				screenSize = event;
				egret.log("ad was resized width" + event.width + "height" + event.height);
			}

			//当用户点击下载按钮时-使用openstoreUrl函数
			function userClickDownloadButton(event){
				dapi.openstoreUrl();
			}</script></body></html>
